a reaver o acesso ao sistema será necessária nova autenticação.<br>     <br>     Por fim, declaro estar ciente e de acordo:<br>     <strong>1.</strong>	com todas as condições constantes neste termo, assumindo inteira responsabilidade pelas consequências legais da utilização indevida desta base de dados; e<br>     <strong>2.</strong>	que se revelar informação obtida mediante acesso aos dados informatizados do Sistema Cartão estarei sujeito às penalidades do art. 325 de Código de Penal, sem prejuízo de outras penalidades; e<br>     <strong>3.</strong>	que se inserir ou facilitar a inserção de dados falsos, alterar ou excluir indevidamente dados corretos no sistema com o fim de obter vantagem indevida para mim ou para outrem ou para causar dano, ou modificar ou alterar o sistema sem autorização ou solicitação de autoridade competente, estarei sujeito às penalidades dos artigos 313-A e 31 3-B do Código Penal, sem prejuízo de outras penalidades, inclusive por outros atos praticados.<br>     <strong>4.</strong>	sem prejuízo da responsabilidade penal e civil, e de outras infrações disciplinares, constitui falta de zelo e dedicação às atribuições do cargo e descumprimento de normas legais e regulamentares, não proceder com cuidado na guarda e utilização de senha ou emprestá-la a outrem, ainda que habilitado.<br>     <strong>5.</strong>	declaro, nesta data, ter ciência e estar de acordo com os procedimentos descritos neste termo, comprometendo-me a respeitá-los e cumpri-los plena e integralmente, além de manter sempre verossímeis os dados de instituição e de minha área de competência.<br> </div>";
